        color: 'red',
        fillColor: '#f03',
        fillOpacity: 0.5,
        radius: 500
    }).addTo(mymap).on('click', display_info);
    var markers = [];
    data.forEach((value, index) => {
        createMarker(value)
    })
//creates markers and adds them to internal markerarray
    function createMarker(meteorite ){
      var color ='#f03';
      if(meteorite!==""){
        color = '#ff7904'
      }
        console.log(meteorite.mass);

        var c = L.circle([meteorite.reclat,meteorite.reclong], {
        color: color,
        fillColor: color,
        fillOpacity: 0.5,
        radius: parseFloat(meteorite.mass)
      }).addTo(mymap).on('click', display_info);
      c.name = meteorite.name;
      c.date = meteorite.year;
      c.info = meteorite.recclass;
      markers.push(c);
        var p = c.bindPopup("meteorimpact - get rekt lmao by: " + c.name)
        p.on('mouseover', function (e) {
            this.openPopup();
        });
        p.on('mouseout', function (e) {
            this.closePopup();
        });
    }
